INSERT INTO `games` (`id`, `title`, `published_date`, `issuer`, `developer`, `description`, `img`, `createdAt`, `updatedAt`, `destroyTime`) VALUES
(2, 'Terraria', '2023-03-08', ' Re-Logic', ' Re-Logic', 'Dig, fight, explore, build! Nothing is impossible in this action-packed adventure game. The whole world is your canvas, and the whole earth is your paint!\nGrab your tools and go! Craft weapons to fight different enemies in different biomes. Dig deeper to find gems, money, and a bunch of other useful stuff. Gather resources to create whatever you need and make the world the way you want it to be. Build your own house, fortress or even a castle! People will move in with you and maybe even sell you things to help you on your travels.\n\nIn addition, you will find many more different tasks and tests. Ready to start?\nKey Features:\nFree Gameplay\nRandomly generated world\nFree updates', , '2023-03-12 18:23:13', '2023-03-12 18:56:44', NULL);
INSERT INTO `games` (`id`, `title`, `published_date`, `issuer`, `developer`, `description`, `img`, `createdAt`, `updatedAt`, `destroyTime`) VALUES
(5, 'Doom Eternal', '2019-01-07', 'Bethesda Softworks', 'id Software', 'In 2163, fourteen years after the events on Mars, Earth has been overrun by demons, wiping out 60% of the planet\'s population, under the corrupt Union Aerospace Corporation (UAC). What remains of humanity has either fled Earth or joined the Armored Response Coalition (ARC) resistance movement. The Doom Slayer, having previously been betrayed by Dr. Samuel Hayden, returns with a satellite fortress controlled by the AI VEGA to quell the demonic invasion by killing the Hell Priests: Deags Nilox, Ranak, and Grav. The priests serve an angelic being known as the Khan Maykr who seeks to sacrifice mankind for her own race\'s survival. The Slayer teleports to Earth and kills Deag Nilox, but the Khan Maykr transports the two remaining priests to unknown locations.', , '2023-03-29 23:06:51', '2023-03-29 23:06:51', NULL);
INSERT INTO `games` (`id`, `title`, `published_date`, `issuer`, `developer`, `description`, `img`, `createdAt`, `updatedAt`, `destroyTime`) VALUES
(6, 'Noita', '2017-01-02', ' Nolla Games', ' Nolla Games', 'Noita is a magical action roguelike set in a physics-based simulation of every pixel. You have to fight with enemies, explore various places, melt, burn, freeze and vaporize obstacles on the way through the procedurally generated world, using your own spells. In search of unknown secrets, you will dive deeper and deeper - in a variety of places: from coal mines to frozen deserts.', , '2023-03-26 21:30:14', '2023-03-26 21:30:14', NULL);
INSERT INTO `games` (`id`, `title`, `published_date`, `issuer`, `developer`, `description`, `img`, `createdAt`, `updatedAt`, `destroyTime`) VALUES
(8, 'No mans sky', '0000-00-00', 'Hello games', 'Hello games', 'Inspired by the adventures and ideas we love from classic sci-fi, No Man\'s Sky takes you to a galaxy full of unique planets and life forms, as well as constant threats and action.\n\nIn No Man\'s Sky, each star is the light of a distant sun that orbits habitable planets that you can travel to if you so choose. Navigate seamlessly between deep space and planetary surfaces, without any loading screens or restrictions. In this endless, procedurally generated universe, you\'ll discover places and creatures you\'ve never seen before and probably never will again.', , '2023-03-29 20:03:07', '2023-03-29 20:08:16', NULL);

